macro.billiam_database.create_within.macro_sql:
{% macro create_within() %}
    {#
    Returns `expr` if it is between `lower_bound` and `upper_bound`, inclusive.
    Otherwise, returns the closest bound.


    Examples:

        SELECT within(5,  1, 10);  -- 5
        SELECT within(0,  1, 10);  -- 1
        SELECT within(11, 1, 10);  -- 10
    #}
    CREATE OR REPLACE MACRO within(expr, lower_bound, upper_bound) AS
        GREATEST(LEAST(expr, upper_bound), lower_bound)
    ;
{% endmacro %}

macro.dbt_duckdb.duckdb__get_delete_inse.macro_sql:
{% macro duckdb__get_delete_insert_merge_sql(target, source, unique_key, dest_columns, incremental_predicates) -%}

    {%- set dest_cols_csv = get_quoted_csv(dest_columns | map(attribute="name")) -%}

    {% if unique_key %}
        {% if unique_key is sequence and unique_key is not string %}
            delete from {{target }} as DBT_INCREMENTAL_TARGET
            using {{ source }}
            where (
                {% for key in unique_key %}
                    {{ source }}.{{ key }} = DBT_INCREMENTAL_TARGET.{{ key }}
                    {{ "and " if not loop.last}}
                {% endfor %}
                {% if incremental_predicates %}
                    {% for predicate in incremental_predicates %}
                        and {{ predicate }}
                    {% endfor %}
                {% endif %}
            );
        {% else %}
